def convert(char):
  number = int(char)
  return number % 100 or 100

def solve(n, a, b, c):
  count_a = defaultdict(int)
  count_b = defaultdict(int)
  count_c = defaultdict(int)
  count = 0
  for i in a:
    count_a[i] += 1
  for i in b:
    count_b[i] += 1
  for i in c:
    count_c[i] += 1
  for x in count_a:
    for y in count_b:
      for z in count_c:
        if tuple(sorted((x, y, z))) in numbers:
          count += count_a[x] * count_b[y] * count_c[z]
  return count

def main():
  n = int(input())
  a = list(map(convert, input().split()))
  b = list(map(convert, input().split()))
  c = list(map(convert, input().split()))
  print(solve(n, a, b, c))

if __name__ == '__main__':
  main()